import React from "react";
import "./App.css";

function App() {
  return (
    <div className="app">
      {/* THIS IS THE CONTAINER FOR THE PHONES IMAGE AND FORM BOX  */}
      <div className="box1">
        <div className="phones">
          <img src="https://i.ibb.co/3FJ24LG/final-Phones.png" alt="phones" />
        </div>
        <div className="formBox"></div>
      </div>

      {/* THIS IS THE CONTAINER FOR THE SIGNUP */}
      <div className="signUp"></div>

      {/* THIS IS THE CONTAINER FOR THE BUTTONS */}
      <div className="buttons"></div>

      {/* THIS IS THE CONTAINER FOR THE FOOTER LINKS */}
      <div className="extLinks"></div>
    </div>
  );
}

export default App;
